import "./Card.css";

function Card(props) {

    function isDone(){
        if(props.done=="True"){
            return <p>This is DONE</p>
        } else {
            return <p>NOT DONE</p>
        }
    }

  return (
    <div className = "ToDoItem">
      <p>{props.Name}</p>
        {isDone()}
    </div>
  );
}

export default Card;
